import React from 'react';
import { Container } from 'react-bootstrap';

const Glosowania = () => {
  return (
    <Container>
      <h1>Głosowania</h1>
      <p>Informacje o głosowaniach.</p>
    </Container>
  );
};

export default Glosowania;
